import React from 'react';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import Footer from '../../components/Footer';
import { useNavigate } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

const ViewManageReseller = ({ userInfo, handleLogout }) => {
    const location = useLocation();
    // Check if location.state and dataItem exist
    const dataItem = location.state?.dataItem;    
    // alert(dataItem)

    const navigate = useNavigate();

    const handleBack = () => {
        navigate('/superadmin/ManageReseller');
    };

    const gridContainerStyle = {
        display: 'grid',
        gridTemplateColumns: 'repeat(4, 1fr)',
        gridGap: '10px',
        padding: '10px',
        // textAlign:'center'
    };

    const gridItemStyle = {
        padding: '10px',
        fontWeight: 'bold',
    };

    return (
        <div className='container-scroller'>
            {/* Header */}
            {/* <Header/> */}
            <Header userInfo={userInfo} handleLogout={handleLogout} />
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Manage Reseller</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button type="button" className="btn btn-success" onClick={handleBack}>Back</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div className="row">
                                            <div className="col-md-12 grid-margin">
                                                <div className="row">
                                                    <div className="col-12 col-xl-12">
                                                        <div style={{textAlign:'center'}}>
                                                            <h4 className="card-title" style={{paddingTop:'10px'}}>Reseller all list</h4>  
                                                            <hr></hr>
                                                        </div>
                                                    </div>
                                                    <div style={gridContainerStyle}>
                                                        <div style={gridItemStyle}>Reseller Name: <span style={{fontWeight:'normal'}}>Saprk Minda</span></div>
                                                        <div style={gridItemStyle}>Phone Number: <span style={{fontWeight:'normal'}}>1234567890</span></div>
                                                        <div style={gridItemStyle}>Emila ID: <span style={{fontWeight:'normal'}}>sparkminda@gamil.com</span></div>
                                                        <div style={gridItemStyle}>Address: <span style={{fontWeight:'normal'}}></span>Bangalore</div>        
                                                        <div style={gridItemStyle}>Created By: <span style={{fontWeight:'normal'}}>UID0009</span></div>                                                  
                                                        <div style={gridItemStyle}>Created Date: <span style={{fontWeight:'normal'}}>UID0009</span></div>
                                                        <div style={gridItemStyle}>Modified By: <span style={{fontWeight:'normal'}}>UID0009</span></div>
                                                        <div style={gridItemStyle}>Modified Date: <span style={{fontWeight:'normal'}}>UID0009</span></div>
                                                        <div style={gridItemStyle}>Status: <span style={{fontWeight:'normal'}}>Ok</span></div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>

                    </div>
                    {/* Footer */}
                    <Footer />
                </div>         
            </div>    
        </div>
    )
}   

export default ViewManageReseller
